function Header() {
  return (
    <div className="App">
      <header>
        <div>
          <img src={logo} className="logo" alt="logo" />
        </div>       

        <div className="barra">
          <input type="text" className="pesquisa" placeholder="Pesquisa"></input>
        </div>

        <div className="links">
          <img src={logo} className="logo" alt="logo" />
          <img src={logo} className="logo" alt="logo" />
          <img src={logo} className="logo" alt="logo" />
          <img src={logo} className="logo" alt="logo" />
          <img src={logo} className="logo" alt="logo" />
        </div>

      </header>
    </div>
  );
}

export default Header;
